import { Outlet } from "react-router-dom"
import Header from "../header/header"
import { Fragment } from 'react';

const Layout = () => {
  return (
    <>
    <Fragment>
      <Header />
      <div className="container">{children}</div>
    </Fragment>
      <Header />
      
      <Outlet />
    </>
  )
}

export default Layout;
